ALTER TABLE LCNEGOTIATIONDISCREPANCY_AUDIT
RENAME COLUMN LASMTODIFIEDDATE 
TO LASTMODIFIEDDATE;


--Alter Table LCNEGOTIATIONDISCREPANCY and Audit, for synchronization of the lenght of the fields with other tables.
alter table LCNEGOTIATIONDISCREPANCY
ALTER COLUMN LCNEGOTIATIONDISCREPANCYSTATUS SET DATA TYPE VARCHAR(9)
ALTER COLUMN NEGOTIATIONBANK SET DATA TYPE VARCHAR(15)
ALTER COLUMN SENDERTORECEIVERINFORMATION SET DATA TYPE VARCHAR(240)
ALTER COLUMN OTHERSNARRATIVE SET DATA TYPE CLOB(3780);

alter table LCNEGOTIATIONDISCREPANCY_AUDIT
ALTER COLUMN LCNEGOTIATIONDISCREPANCYSTATUS SET DATA TYPE VARCHAR(9)
ALTER COLUMN NEGOTIATIONBANK SET DATA TYPE VARCHAR(15)
ALTER COLUMN SENDERTORECEIVERINFORMATION SET DATA TYPE VARCHAR(240)
ALTER COLUMN OTHERSNARRATIVE SET DATA TYPE CLOB(3780);


--Alter Table LCNEGOTIATION and Audit, for synchronization of the length of the fields with other tables.
