alter table LETTEROFCREDIT_AUDIT
ALTER COLUMN SENDERTORECEIVERINFORMATION SET DATA TYPE VARCHAR(240);



--Alter Table LCNEGOTIATIONDISCREPANCY and Audit, for the new fields needed by the program
ALTER TABLE LCNEGOTIATIONDISCREPANCY
ADD COLUMN ICDATE TIMESTAMP;
Add COLUMN REASONFORCANCELLATION VARCHAR(100)
Add COLUMN REGULARAMOUNT DECIMAL(19,2)
Add COLUMN CASHAMOUNT DECIMAL(19,2);


ALTER TABLE LCNEGOTIATIONDISCREPANCY_AUDIT
ADD COLUMN ICDATE TIMESTAMP
Add COLUMN REASONFORCANCELLATION VARCHAR(100)
Add COLUMN REGULARAMOUNT DECIMAL(19,2)
Add COLUMN CASHAMOUNT DECIMAL(19,2);

--For Reorg of the table
