call sysproc.admin_cmd('reorg table LCNEGOTIATIONDISCREPANCY_AUDIT');

call sysproc.admin_cmd('reorg table LCNEGOTIATION');
call sysproc.admin_cmd('reorg table LCNEGOTIATION_AUDIT');

